import React from 'react';
import ReactDOM from 'react-dom';


import './index.css';
import App from './App';
import Signin from '../components/Signup';
import {
  BrowserRouter,
  Routes,
  Route,
  Link,
  Outlet,
} from "react-router-dom";

ReactDOM.render(
  <BrowserRouter>
  <Routes>
    <Route path="/" element={<App />} />
    <Route path="/signup" element={<Signup />}>

    </Route>
  </Routes>
</BrowserRouter>,
  document.getElementById('root')
);

